import * as React from "react";
import Box from "@mui/material/Box";
import Container from "@mui/material/Container";
import "./Forgotpassword.css";
import InputBase from "@mui/material/InputBase";
import { styled } from "@mui/material/styles";
import InputLabel from "@mui/material/InputLabel";
import FormControl from "@mui/material/FormControl";
import Button from "@mui/material/Button";
import { Typography } from "@mui/material";
import InputUnstyled, { inputUnstyledClasses } from "@mui/base/InputUnstyled";
import ButtonUnstyled from "@mui/base/ButtonUnstyled";
import { useState } from "react";
import PropTypes from "prop-types";

const purpl = {
  100: "#F5E1FF",
  200: "#CC99FF",
  400: "#9F40FF",
  500: "#7F00FF",
  600: "#6600CC",
};

const grey = {
  50: "#F3F6F9",
  100: "#E7EBF0",
  200: "#E0E3E7",
  300: "#CDD2D7",
  400: "#B2BAC2",
  500: "#A0AAB4",
  600: "#6F7E8C",
  700: "#3E5060",
  800: "#2D3843",
  900: "#1A2027",
};
const StyledInputRoot = styled("div")(
  ({ theme }) => `
 
  font-weight: 400;
  border-radius: 5px;
  color: ${theme.palette.mode === "light" ? grey[300] : grey[500]};
  background: ${theme.palette.mode === "dark" ? grey[900] : "#fff"};
  border: 1px solid ${theme.palette.mode === "dark" ? purpl[700] : grey[200]};
  box-shadow: 0px 2px  5px #b393d3 ${
    theme.palette.mode === "dark" ? grey[900] : grey[50]
  };
  display: flex;
  align-items: center;
  justify-content: center;


  &.${inputUnstyledClasses.focused} {
    border-color: ${purpl};
    box-shadow: 0px 0px 5px #b393d3, 0px 0px 10px #b393d3, 0px 0px 10px #b393d3, 0px 0px 20px #b393d3;

  }

  &:hover {
    border-color: ${purpl[400]};
  }

  // firefox
  &:focus-visible {
    outline: 0;
  }
`
);

const StyledInputElement = styled("input")(
  ({ theme }) => `
  font-size: 0.8rem;
  font-family: inherit;
  font-weight: 400;
  line-height: 1.5;
  color: ${theme.palette.mode === "dark" ? grey[300] : grey[900]};
  background: inherit;
  border: none;
  border-radius: inherit;
  padding: 12px 12px;
  outline: 0;
`
);

const IconButton = styled(ButtonUnstyled)(
  ({ theme }) => `
  display: inline-flex;
  align-items: center;
  justify-content: center;
  border: none;
  size:10px,
  background: inherit;
  cursor: pointer;
  color: ${theme.palette.mode === "dark" ? grey[300] : grey[700]};
  `
);

const InputAdornment = styled("div")`
  margin: 8px;
  display: inline-flex;
  align-items: center;
  justify-content: center;
`;

const CustomInput = React.forwardRef(function CustomInput(props, ref) {
  const { slots, ...other } = props;
  return (
    <InputUnstyled
      slots={{
        root: StyledInputRoot,
        input: StyledInputElement,
        ...slots,
      }}
      {...other}
      ref={ref}
    />
  );
});

CustomInput.propTypes = {
  slots: PropTypes.shape({
    input: PropTypes.elementType,
    root: PropTypes.elementType,
    textarea: PropTypes.elementType,
  }),
};
function Forgotpassword() {
  const [email, setemail] = useState("");

  const handleChange = (event) => {
    setemail(event.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const useremail = email;
    fetch("", {
      method: "",
      Headers: { "Content-type": "applicetion/jason" },
      body: JSON.stringify(useremail),
    }).then(() => {
      console.log("email send");
    });
  };

  return (
    <Box className="boxxF">
      <React.Fragment>
        <Container maxWidth="xs">
          <Box className="mainF">
            <FormControl variant="standard" sx={{ padding: "60px" }}>
              <Typography
                style={{
                  textAlign: "center",
                  marginTop: "0px",
                  color: "#fefdfe",
                  textShadow:
                    " 0px 0px 5px #b393d3, 0px 0px 10px #b393d3, 0px 0px 10px #b393d3,0px 0px 20px #b393d3",
                  fontFamily: "Proxima Nova,Verdana,Avenir Next",
                }}
              >
                <h3>Forgot Password </h3>
              </Typography>
              <br />
              <Typography
                style={{ fontSize: 12, color: "gray", textAlign: "start" }}
              >
                Lost your password ?<br />
                Please enter your email address. You will receive a link to
                create a new password via email.
              </Typography>
              <br />

              <Box style={{ display: "flex", flexDirection: "center" }}>
                <InputLabel
                  shrink
                  htmlFor=" email"
                  sx={{
                    color: "gris",
                    marginTop: "170px",
                    marginLeft: "25px",
                    padding: "50px",
                    "&.Mui-focused": { color: "purple" },
                  }}
                >
                  Email
                </InputLabel>
                <CustomInput
                  onChange={handleChange}
                  value={email}
                  id="outlined-start-adornment"
                  startAdornment={<InputAdornment> </InputAdornment>}
                />
              </Box>

              <Button
                type="submit"
                color="secondary"
                variant="outlined"
                sx={{ mt: 2, mb: 2, marginLeft: "0px" }}
              >
                Send email
              </Button>
            </FormControl>
          </Box>
        </Container>
      </React.Fragment>
    </Box>
  );
}

export default Forgotpassword;
